import React from 'react'
import './Nav.scss'
import { Link } from 'react-router-dom'
import MenuBtn from '../menu/MenuBtn'

const Nav = () => {

    let newStyle = {
        display: "none"
    };
    if (window.innerWidth > 800) {
        newStyle = {
            display: "flex"
        }
    } else {
        newStyle = {
            display: "none"
        }
    }

    return (
        <>
        <div className="nav" style={newStyle}>
        <ul>
           <Link style={{textDecoration: "none", flex: "1", color: "black"}} to="/"> <li>Home</li> </Link> 
           <Link style={{textDecoration: "none", flex: "1", color: "black"}} to="/packages"> <li>Packages</li> </Link> 
           <Link style={{textDecoration: "none", flex: "1", color: "black"}}> <li>Purchase</li> </Link> 
           <Link style={{textDecoration: "none", flex: "1", color: "black"}}> <li>Contact</li> </Link>

        </ul>

        </div>

        <MenuBtn />

</> 
    )
}

export default Nav
